import React from 'react'
import ProjecItem from "../components/ProjectItem";
import ignitelogo from "../assets/ignitelogo.webp";
import antsvsbees from "../assets/antsvsbees.png";
import schemeinterpreter from "../assets/schemeinterpreter.png";
import urcrover from "../assets/urcrover.jpeg";

import "../styles/Projects.css"

function Projects() {
  return (
    <div className='projects'>
      <h1> My Personal Projects</h1>
      <div className='projectList'> 
        <ProjecItem name="Path Planning AI Rover" image={urcrover} />
        <ProjecItem name="Ignite Youth Club" image={ignitelogo} />
        <ProjecItem name="Ants vs Bees" image={antsvsbees} />
        <ProjecItem name="Scheme Interpreter" image={schemeinterpreter} />
      </div>
    </div>
  );
}

export default Projects
